import styled from 'styled-components';

const Navbar = styled.nav`
  position: sticky;
  top: 0;
  left: 0;
  right: 0;
  min-height: 50px;
  background: var(--bg);
  .logo{
    color: var(--red);
  }
  .container{
    display: flex;
  }
`;

const Searchbar = styled.div`
  position: sticky;
  top: 50px;
  left: 0;
  right: 0;
  min-height: 50px;
  background: var(--bg);
`;

function App() {
  return (
  <>
    <Navbar>
      <div className="container">
        <a href="/" className="logo">MOVIE DB</a>
        <button>장르별</button>
        <button>연도별</button>
        <div>1</div>
        <div>2</div>
      </div>
    </Navbar>
    <Searchbar>
    <div className="container">Search</div>
    </Searchbar>
  </>
  );
}

export default App;
